import './App.css';

function App() {
  const title ='Welcome to the new blog';
  const like = 50;
  // const person ={ name:'yoshi',age: 30};
  const link ="http://www.google.com";
return (
    <div className="App">
      <div className="content">
      <h1>{title}</h1>
      <p>liked{like} time</p>
      {/* <p>{person}</p> */}
      <p>{10}</p>
      <p>{"hello ,ninjas"}</p>
      <p>{[1,2,3,4,5]}</p>
      <p>{Math.random() * 10}</p>
      <a href={link}>google site</a>
      </div>
     </div>
       );
      }

export default App;
